import React,{useState} from "react";
import { useDispatch } from "react-redux";
const DetailPage = ()=>{

    const dispatch = useDispatch();
    const { id } = useParams();
    const [dog, setDog] = useState({});
  
    useEffect(() => {
      dispatch(fetchDogById(id)).then((res) => {
        setDog(res.payload);
      });
    }, [dispatch, id]);


    return(
        <h1>Dog Details </h1>
    )
}


export default DetailPage
